# Assign rooms for reservations

DROP PROCEDURE IF EXISTS AssignRooms;

# This procedure will assign rooms to every reservation. The property will be randomly decided. 

DELIMITER $$
CREATE PROCEDURE AssignRooms()
BEGIN
	DECLARE n INT DEFAULT 0;
    DECLARE i INT DEFAULT 0;
    DECLARE checkIn DATE;
    DECLARE checkOut DATE;
    DECLARE stayLength INT;
    DECLARE roomNumber INT;
    DECLARE reservationId INT;
    DECLARE propertyName VARCHAR(100);
	DECLARE roomCount INT;
    DECLARE roomI INT DEFAULT 0;
	SELECT Count(*) FROM Reservation INTO n;
    WHILE i < n DO
		# Get the details of the current reservation
        SET checkIn = (SELECT check_in FROM Reservation ORDER BY reservation_id LIMIT i, 1);
        SET checkOut = (SELECT check_out FROM Reservation ORDER BY reservation_id  LIMIT i, 1);
        SET propertyName = (SELECT property_name FROM Reservation ORDER BY reservation_id LIMIT i, 1);
        SET reservationId = (SELECT reservation_id FROM Reservation ORDER BY reservation_id LIMIT i, 1);
        
        # Get number of days needed
        SET stayLength = DATEDIFF(checkOut, checkIn);
        
        # Get the room number to be assigned. 
        SET roomNumber = 
        (
			SELECT room_num
			FROM (SELECT room_num FROM Room_Date WHERE (_date >= checkIn AND _date < checkOut AND Room_Date.property_name = propertyName AND reservation_ID IS NULL)) AS T
            GROUP BY room_num
            HAVING COUNT(*) = stayLength
            ORDER BY room_num
            LIMIT 0, 1
        );
        
        # The reservation cannot be assigned a room
        # it would be best to remove the reservation from the system
        # Otherwise, make the assignment
		IF roomNumber IS NULL THEN
			DELETE FROM Reservation WHERE reservation_id = reservationId;
            SET n = n - 1;
		ELSE 	
			UPDATE Room_Date
            SET reservation_id = reservationId
            WHERE (room_num = roomNumber AND _date >= checkIn AND _date < checkOut AND property_name = propertyName AND reservation_id IS NULL);
			
            UPDATE Reservation
			SET total_price = (SELECT SUM(rate) FROM Room_Date WHERE reservation_id = reservationId GROUP BY reservation_id)
			WHERE reservation_id = reservationId;
		
			SET i = i + 1;
        END IF;
    END WHILE;
END$$
DELIMITER ;;

CALL AssignRooms();





